description:
De goa'uld en de replicators vormen een vaste bedreiging. Er wordt kennisgemaakt met de Unas, de eerste gastheer van de goa'uld. Apophis wordt uiteindelijk overwonnen

21.Meridian - 10 May 2002 - Nadat een beschaving het element Naquadria heeft ontdekt en er een massa vernietigingswapen van proberen te maken, gaat het bijna mis en weet Daniel een ramp te voorkomen. Hierbij wordt hij besmet met straling en in zijn sterfbed wordt hij door Oma Desela opgeroepen om een Ascended Being te worden.

22.Revelations - 17 May 2002 - Osiris valt een geheim Asgard lab aan en SG-1 gaat de wetenschapper proberen te redden.
